import styled from "styled-components"

export const StyledProjectsContainer = styled.div`
	-ms-overflow-style: none;
	scrollbar-width: none;
	::-webkit-scrollbar {
		display: none;
	}

	display: flex;
	align-items: center;
	grid-area: Projects;
	overflow-x: scroll;
	overflow-y: hidden;
	padding-left: 7.5vw;
	width: 92.5vw;
	height: 40vh;
`
